
public class Loop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int n=10;
		
		// while loop
		while(n<30)
		{
			n++;
			System.out.println(n);
		}
		
		// do while loop
		do
		{
			n++;
			System.out.println(n);	
		}while(n<=50);
		
		// for loop
		for(int a=10;a<=50; a++)
		{
			System.out.println(a);
		}
		
	}
}